import styled from 'styled-components';
import blinkyIcon from '../assets/blinkyIcon.png';
import batteryFull from '../assets/batteryFull.svg';
import batteryEmpty from '../assets/batteryEmpty.svg';

const navBarStyle = {
  backgroundColor: '#FF9999',
  width: '100%',
  height: '15vh',
  color: '#FFFFFF',
  padding: '10px',
  boxSizing: 'border-box',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'space-between',
  gap: '20px',
  borderBottom: '2px solid #FFBEBE'
}

const HeaderComponent = styled.div`
  display: flex;
  align-items: center;
`

const StyledImage = styled.img`
  height: 14vh;
`

const StyledBattery = styled.img`
  height: 7vh;
  width: auto;
`

const NavBar = ({charge}) => {
  return <>
    <header style={navBarStyle}>
      <HeaderComponent>
        <StyledImage src={blinkyIcon} alt={'robot icon'}/>
        <h1>Blinky the HSR</h1>
      </HeaderComponent>
      <HeaderComponent>
        <div style={{ fontWeight: 'bold', fontSize: '1.2em'}}>{charge}</div>
        {charge > 50 ? 
          <StyledBattery src={batteryFull} alt={'Full battery'}/>
          : <StyledBattery src={batteryEmpty} alt={'Empty battery'}/>
        }
      </HeaderComponent>
    </header>
  </>
}

export default NavBar
